constructor(props) {
    super(props);
    this.state = {
        selectedValue: "myself",
        destinations: ["myself","somebody"],
    };
}

    componentDidMount(){
        console.log('passou')
        fetch('/categorias')
            .then(response => response.json())
            .then(data => this.setState({categorias: data}));
    }
}

export default CategoriaList;
